import React from "react";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import AboutPage from "../about/AboutPage";

function HomePage() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/about" element={<AboutPage />} />
      </Routes>
    </BrowserRouter>
  );
}

export default HomePage;
